    text-align: end;
    margin-top: 8px;
    margin-right: 8px;
    background-color: getColor("white");
    outline: none;
    padding: 0;
    border-radius: 50%;
    border: 1px solid rgba(0, 0, 0, 0.1);
    transition: transformFunc(fill);
    cursor: pointer;

    &:hover,
    &:focus {
      fill: getColor("blue");
    }
  }

  &__title {
    font-family: Roboto;
    font-style: normal;
    font-weight: 700;
    font-size: 20px;
    line-height: 1.15;
    text-align: center;
