.form {
  margin-left: 40px;
  margin-right: 40px;
  margin-top: 12px;

  &__field {
    display: flex;
    flex-direction: column;
    text-align: left;
    &:not(:first-child) {
      margin-top: 10px;
    }
  }

  &__label {
    margin-bottom: 4px;
    font-family: Roboto;
    font-style: normal;
    font-weight: normal;
    font-size: 12px;
    line-height: 1.17;

    color: getColor("grey");
    letter-spacing: 0.01em;
  }

  &__wrapper {
    position: relative;
    transform: translateY(0%);
  }

  &__svg {
    position: absolute;
    top: 0;
    left: 0;
    margin: 11px 11px;
    transition: transitionFunc(fill);
  }
}
.form__input {
  margin: 0px;
  position: absolute;
  padding-top: 12px;
  padding-bottom: 12px;
  padding-right: 15px;
  padding-left: 42px;
  position: relative;
  width: 100%;
  height: 40px;

  font-family: Roboto;
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 1.17;
  letter-spacing: 0.01em;
  border: 1px solid rgba(33, 33, 33, 0.2);
  transition: transitionFunc(border-color);

  border-radius: 4px;

  &::placeholder {
    font-size: 14px;
  }

  &--textarea {
    width: 100%;
    height: 120px;
    padding: 12px 16px;
    resize: none;
  }

  &:focus {
    border-color: getColor("blue");
    outline: none;
  }

  &:focus + .form__svg {
    fill: getColor("blue");
  }

  & .checkbox {
    display: flex;
    justify-content: center;
    flex-direction: row;

    align-items: center;

    margin-top: 20px;
    margin-bottom: 30px;
  }
}
.checkbox {
  display: flex;
  justify-content: center;
  flex-direction: row;
  align-items: center;
  margin-top: 20px;
  margin-bottom: 30px;
  &__input:focus + &__wrapper > &__item {
    background-image: url(../images/studio/checkbox-off.svg);
  }
  &__input:checked + &__wrapper > &__item,
  &__input:focus:checked + &__wrapper > &__item {
    background-image: url(../images/studio/checkbox-on.svg);
  }
  &__label {
    text-align: center;
    font-family: Roboto;
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 1.71;
    letter-spacing: 0.03em;
    margin-bottom: 0;
    margin-left: 9px;
    color: getColor("grey");
    padding-left: 16px;
  }
  &__input {
    position: absolute;
    width: 1px;
    height: 1px;
    overflow: hidden;
    clip: rect(0 0 0 0);
  }

  &__wrapper {
    position: relative;
  }

  &__item {
    position: absolute;
    width: 16px;
    height: 15px;
    left: 0;
    top: 0;
    transform: translateY(25%);
    background-image: url(../images/studio/checkbox-off.svg);
  }
}
