.products {
  display: flex;
  flex-wrap: wrap;
  margin-bottom: 94px;

  &__link {
    display: block;
    font-size: 0;
    text-decoration: none;

    &:focus {
      box-shadow: 0px 1px 1px rgba(0, 0, 0, 0.12),
        0px 4px 4px rgba(0, 0, 0, 0.06), 1px 4px 6px rgba(0, 0, 0, 0.16);
    }
  }

  &__image {
    display: block;
    width: 100%;
    height: auto;
  }

  &__name {
    display: block;
    min-width: 322px;
    padding: 20px 24px 4px 24px;
    font-family: Roboto;
    font-weight: 700;
    font-size: 18px;
    line-height: 2;
    letter-spacing: 0.06em;
    color: getColor("black");
  }

  &__type {
    display: block;
    min-width: 322px;
    padding: 4px 24px 20px 24px;
    font-family: Roboto;
    font-weight: 400;
    font-size: 16px;
    line-height: 1.87;
    letter-spacing: 0.03em;
    color: getColor("grey");
  }
}

.products__item {
  border: 1px solid getColor("white-bg-btn");
  width: calc((100% - 60px) / 3);
  margin-right: 30px;
  margin-bottom: 30px;
  transition: transitionFunc(box-shadow);

  &:nth-child(3n) {
    margin-right: 0px;
  }
  &:nth-last-child(-n + 3) {
    margin-bottom: 0px;
  }
  &:hover {
    box-shadow: 0px 1px 1px rgba(0, 0, 0, 0.12), 0px 4px 4px rgba(0, 0, 0, 0.06),
      1px 4px 6px rgba(0, 0, 0, 0.16);
  }
}
.overlay {
  position: relative;
  width: 100%;
  overflow: hidden;

  &__text {
    position: absolute;
    padding: 63px 24px;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 100%;
    transform: translateY(101%);
    pointer-events: none;
    transition: transitionFunc(transform);

    font-family: Roboto;
    font-size: 18px;
    font-weight: 400;
    line-height: 1.55;
    letter-spacing: 0.03em;
    text-align: left;
    color: getColor("white");
    background-color: rgba(33, 150, 243, 0.9);
    text-decoration: none;
  }

  .products__item:hover &__text,
  .products__link:focus &__text {
    transform: translateY(0);
  }
}
